import React from "react";
import Card from "../Card/Card";
import "./Compare.scss";

function Compare(props) {
  return (
    <div className="container">
      {props.lunarApi.map((api) => {
        return <Card key={api.id} coinName={api.n} coinPrice={api.p} />;
      })}
      <Card />
    </div>
  );
}

export default Compare;
